  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains photographic information
  obtained for the National Agricultural Imagery Program (NAIP) and is comprised of
  scanned photographs that were acquired with a precision aerial mapping camera at
  a nominal scale of 1:40,000 on color positive film. Acquisition was leaf on with
  mature crops prior to harvest. Images have been orthorectified. NAIP imagery is
  quarter-quadrangle centered to provide consistent and repeatable coverage.\",\n\t\"license_title\":
